import axios from "axios";
import { useEffect, useState } from "react";


const Users = () => {
    const [users, setUsers] = useState([]);
    console.log("users", users)
    useEffect(()=>{
        axios.get("http://localhost:3005/register/users")
        .then((response)=>setUsers([response.data]))
    },[]) 
    const mappedUsers = users[0].map((user, i)=>{
        return (
           <tr key={i}>
            <td>
                {user.username}
            </td>
            <td>
            {user.email}
            </td>
           </tr>
        )
    }) 
    console.log("users", users)

    return(
        <table className="users-table">
            <thead>
                <td>
                    Username
                </td>
                <td>
                    Email
                </td>
            </thead>
            <tbody>
                 {mappedUsers}
            </tbody>
          
        </table>
    )
}

export default Users;
